package a01_diexp.vo;

public class Romeo {
	private String gender;
	private int age;
	public Romeo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Romeo(String gender, int age) {
		super();
		this.gender = gender;
		this.age = age;
	}
	public String getGender() {
		return gender;
	}
	public void setGender(String gender) {
		this.gender = gender;
	}
	public int getAge() {
		return age;
	}
	public void setAge(int age) {
		this.age = age;
	}
	
}
